import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { FontAwesomeModule } from '@fortawesome/angular-fontawesome';
import { FormsModule } from '@angular/forms';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { DeliveryPeopleComponent } from './components/delivery-people/delivery-people.component';
import { HeaderComponent } from './components/header/header.component';
import { ListComponent } from './components/list/list.component';
import { OrderComponent } from './components/order/order.component';
import { SignInComponent } from './components/sign-in/sign-in.component';
import { HikesComponent } from './components/hikes/hikes.component';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    DeliveryPeopleComponent,
    ListComponent,
    OrderComponent,
    SignInComponent,
    HikesComponent,
  ],
  imports: [BrowserModule, HttpClientModule, AppRoutingModule, FontAwesomeModule, FormsModule],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
